<h2>Tại sao cần Generics</h2>
<blockquote>
<p>Bản chất của Generics là tham số hóa kiểu dữ liệu (cho phép kiểm soát kiểu dữ liệu cụ thể của tham số mà không cần tạo ra kiểu dữ liệu mới). Nghĩa là trong quá trình sử dụng Generics, kiểu dữ liệu được chỉ định là một tham số, tham số này có thể được sử dụng trong lớp, interface và phương thức, tương ứng được gọi là lớp Generics, interface Generics và Generics method.</p>
