<p>"Vấn đề này trông có vẻ đơn giản, nhưng lại có hơn 3.7 triệu lượt truy cập trên Stack Overflow". "Vấn đề này cũng có thể mở rộng ra thành sự khác biệt giữa <code>.equals()</code> và toán tử '==' là gì."</p>
