<h3>1.1 Phép toán bit và hệ nhị phân</h3>
<blockquote>
<p><strong>Phép toán bit (Bit Operation)</strong>: Trong máy tính, số được lưu trữ dưới dạng "hệ nhị phân (Binary)". Phép toán bit là việc thực hiện các phép toán trực tiếp trên biểu diễn nhị phân của số. Sử dụng phép toán bit trong chương trình có thể cải thiện hiệu suất của chương trình đáng kể.</p>
